import React from 'react';
import ReactDOM from 'react-dom/client';
import Car from './Car';


function Garage () {
    return (
        <h2>Hello, this is {params.color} car!</h2>
    );
}

ReactDOM.createRoot(document.getElementById('root')).render(<Car color='white' />);
